package en.bible;

public class enbible53 {

public enbible53() {

putmapbible53();

}

private void putmapbible53() {

ensuperobject.biblemap.put("b53_1_1", new ensuperobject(53,1,1,"Paul, and Silvanus, and Timotheus, unto the church of the Thessalonians in God our Father and the Lord Jesus Christ:"));
ensuperobject.biblemap.put("b53_1_2", new ensuperobject(53,1,2,"Grace unto you, and peace, from God our Father and the Lord Jesus Christ."));
ensuperobject.biblemap.put("b53_1_3", new ensuperobject(53,1,3,"We are bound to thank God always for you, brethren, as it is meet, because that your faith groweth exceedingly, and the charity of every one of you all toward each other aboundeth;"));
ensuperobject.biblemap.put("b53_1_4", new ensuperobject(53,1,4,"So that we ourselves glory in you in the churches of God for your patience and faith in all your persecutions and tribulations that ye endure:"));
ensuperobject.biblemap.put("b53_1_5", new ensuperobject(53,1,5,"Which is a manifest token of the righteous judgment of God, that ye may be counted worthy of the kingdom of God, for which ye also suffer:"));
ensuperobject.biblemap.put("b53_1_6", new ensuperobject(53,1,6,"Seeing it is a righteous thing with God to recompense tribulation to them that trouble you;"));
ensuperobject.biblemap.put("b53_1_7", new ensuperobject(53,1,7,"And to you who are troubled rest with us, when the Lord Jesus shall be revealed from heaven with his mighty angels,"));
ensuperobject.biblemap.put("b53_1_8", new ensuperobject(53,1,8,"In flaming fire taking vengeance on them that know not God, and that obey not the gospel of our Lord Jesus Christ:"));
ensuperobject.biblemap.put("b53_1_9", new ensuperobject(53,1,9,"Who shall be punished with everlasting destruction from the presence of the Lord, and from the glory of his power;"));
ensuperobject.biblemap.put("b53_1_10", new ensuperobject(53,1,10,"When he shall come to be glorified in his saints, and to be admired in all them that believe (because our testimony among you was believed) in that day."));
ensuperobject.biblemap.put("b53_1_11", new ensuperobject(53,1,11,"Wherefore also we pray always for you, that our God would count you worthy of this calling, and fulfil all the good pleasure of his goodness, and the work of faith with power:"));
ensuperobject.biblemap.put("b53_1_12", new ensuperobject(53,1,12,"That the name of our Lord Jesus Christ may be glorified in you, and ye in him, according to the grace of our God and the Lord Jesus Christ."));
ensuperobject.biblemap.put("b53_2_1", new ensuperobject(53,2,1,"Now we beseech you, brethren, by the coming of our Lord Jesus Christ, and by our gathering together unto him,"));
ensuperobject.biblemap.put("b53_2_2", new ensuperobject(53,2,2,"That ye be not soon shaken in mind, or be troubled, neither by spirit, nor by word, nor by letter as from us, as that the day of Christ is at hand."));
ensuperobject.biblemap.put("b53_2_3", new ensuperobject(53,2,3,"Let no man deceive you by any means: for that day shall not come, except there come a falling away first, and that man of sin be revealed, the son of perdition;"));
ensuperobject.biblemap.put("b53_2_4", new ensuperobject(53,2,4,"Who opposeth and exalteth himself above all that is called God, or that is worshipped; so that he as God sitteth in the temple of God, shewing himself that he is God."));
ensuperobject.biblemap.put("b53_2_5", new ensuperobject(53,2,5,"Remember ye not, that, when I was yet with you, I told you these things?"));
ensuperobject.biblemap.put("b53_2_6", new ensuperobject(53,2,6,"And now ye know what withholdeth that he might be revealed in his time."));
ensuperobject.biblemap.put("b53_2_7", new ensuperobject(53,2,7,"For the mystery of iniquity doth already work: only he who now letteth will let, until he be taken out of the way."));
ensuperobject.biblemap.put("b53_2_8", new ensuperobject(53,2,8,"And then shall that Wicked be revealed, whom the Lord shall consume with the spirit of his mouth, and shall destroy with the brightness of his coming:"));
ensuperobject.biblemap.put("b53_2_9", new ensuperobject(53,2,9,"Even him, whose coming is after the working of Satan with all power and signs and lying wonders,"));
ensuperobject.biblemap.put("b53_2_10", new ensuperobject(53,2,10,"And with all deceivableness of unrighteousness in them that perish; because they received not the love of the truth, that they might be saved."));
ensuperobject.biblemap.put("b53_2_11", new ensuperobject(53,2,11,"And for this cause God shall send them strong delusion, that they should believe a lie:"));
ensuperobject.biblemap.put("b53_2_12", new ensuperobject(53,2,12,"That they all might be damned who believed not the truth, but had pleasure in unrighteousness."));
ensuperobject.biblemap.put("b53_2_13", new ensuperobject(53,2,13,"But we are bound to give thanks alway to God for you, brethren beloved of the Lord, because God hath from the beginning chosen you to salvation through sanctification of the Spirit and belief of the truth:"));
ensuperobject.biblemap.put("b53_2_14", new ensuperobject(53,2,14,"Whereunto he called you by our gospel, to the obtaining of the glory of our Lord Jesus Christ."));
ensuperobject.biblemap.put("b53_2_15", new ensuperobject(53,2,15,"Therefore, brethren, stand fast, and hold the traditions which ye have been taught, whether by word, or our epistle."));
ensuperobject.biblemap.put("b53_2_16", new ensuperobject(53,2,16,"Now our Lord Jesus Christ himself, and God, even our Father, which hath loved us, and hath given us everlasting consolation and good hope through grace,"));
ensuperobject.biblemap.put("b53_2_17", new ensuperobject(53,2,17,"Comfort your hearts, and stablish you in every good word and work."));
ensuperobject.biblemap.put("b53_3_1", new ensuperobject(53,3,1,"Finally, brethren, pray for us, that the word of the Lord may have free course, and be glorified, even as it is with you:"));
ensuperobject.biblemap.put("b53_3_2", new ensuperobject(53,3,2,"And that we may be delivered from unreasonable and wicked men: for all men have not faith."));
ensuperobject.biblemap.put("b53_3_3", new ensuperobject(53,3,3,"But the Lord is faithful, who shall stablish you, and keep you from evil."));
ensuperobject.biblemap.put("b53_3_4", new ensuperobject(53,3,4,"And we have confidence in the Lord touching you, that ye both do and will do the things which we command you."));
ensuperobject.biblemap.put("b53_3_5", new ensuperobject(53,3,5,"And the Lord direct your hearts into the love of God, and into the patient waiting for Christ."));
ensuperobject.biblemap.put("b53_3_6", new ensuperobject(53,3,6,"Now we command you, brethren, in the name of our Lord Jesus Christ, that ye withdraw yourselves from every brother that walketh disorderly, and not after the tradition which he received of us."));
ensuperobject.biblemap.put("b53_3_7", new ensuperobject(53,3,7,"For yourselves know how ye ought to follow us: for we behaved not ourselves disorderly among you;"));
ensuperobject.biblemap.put("b53_3_8", new ensuperobject(53,3,8,"Neither did we eat any man's bread for nought; but wrought with labour and travail night and day, that we might not be chargeable to any of you:"));
ensuperobject.biblemap.put("b53_3_9", new ensuperobject(53,3,9,"Not because we have not power, but to make ourselves an ensample unto you to follow us."));
ensuperobject.biblemap.put("b53_3_10", new ensuperobject(53,3,10,"For even when we were with you, this we commanded you, that if any would not work, neither should he eat."));
ensuperobject.biblemap.put("b53_3_11", new ensuperobject(53,3,11,"For we hear that there are some which walk among you disorderly, working not at all, but are busybodies."));
ensuperobject.biblemap.put("b53_3_12", new ensuperobject(53,3,12,"Now them that are such we command and exhort by our Lord Jesus Christ, that with quietness they work, and eat their own bread."));
ensuperobject.biblemap.put("b53_3_13", new ensuperobject(53,3,13,"But ye, brethren, be not weary in well doing."));
ensuperobject.biblemap.put("b53_3_14", new ensuperobject(53,3,14,"And if any man obey not our word by this epistle, note that man, and have no company with him, that he may be ashamed."));
ensuperobject.biblemap.put("b53_3_15", new ensuperobject(53,3,15,"Yet count him not as an enemy, but admonish him as a brother."));
ensuperobject.biblemap.put("b53_3_16", new ensuperobject(53,3,16,"Now the Lord of peace himself give you peace always by all means. The Lord be with you all."));
ensuperobject.biblemap.put("b53_3_17", new ensuperobject(53,3,17,"The salutation of Paul with mine own hand, which is the token in every epistle: so I write."));
ensuperobject.biblemap.put("b53_3_18", new ensuperobject(53,3,18,"The grace of our Lord Jesus Christ be with you all. Amen."));

}

}